import React, { useState } from 'react';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import { StyledCard, StyledCardMedia } from './styles';
import lockImg from '../../assets/images/lock-icon.png';
import Input from '@mui/material/Input';

export interface AboutProps {
  login: obj;
  error: obj;
}

const Login: React.FunctionComponent<AboutProps> = ({ login, error }) => {
  const [credentials, setCredentials] = useState({ name: '', password: '' });

  const handleSubmit = (e) => {
    e.preventDefault();

    login(credentials);
  };

  return (
    <StyledCard sx={{ maxWidth: 345 }}>
      <StyledCardMedia component="img" src={lockImg} alt="green iguana" />
      <CardContent>
        <Typography gutterBottom variant="h5" component="div">
          Please Sign
        </Typography>
        <Typography variant="body2" color="text.secondary">
          Welcome to Go REST API.
        </Typography>
        <form onSubmit={handleSubmit}>
          <Input name="username" placeholder="Username" fullWidth />
          <Input name="password" placeholder="Password" fullWidth />
        </form>
      </CardContent>
      <CardActions>
        <Button size="small">Login</Button>
      </CardActions>
    </StyledCard>
  );
};

export default Login;
